import React from "react";
import $ from "jquery";

// function traeLibro ( state ) {
const traeLibro = ( state ) => {
	let input_buscar = $( "input.input_buscar" ).val();
	console.log( input_buscar );
	// var state = [];
	var algo = {
		"nombre" : "nnnnnnn" ,
		"apellido" : input_buscar ,
	}
	state.push({nombre: algo.nombre , apellido: algo.apellido})
	console.log( state );
	state( state );
}

export {
	traeLibro
}
